import React from "react";
import { useState } from "react";


const App=()=>{
    let time  = new Date().toLocaleTimeString();
    const [ctime,setCtime] = useState(time)

    const run =()=>{
        time  = new Date().toLocaleTimeString();
        setCtime(time);
    }
    return(
        <>
        <h1>{ctime}</h1>
        <button onClick={run}>click me!</button>
        </>
    )
}

export default App
